B.Ol=new A.d(B.c,["\u091a\u0924\u0941\u0930\u094d\u0935\u093f\u0927\u093e \u092d\u091c\u0928\u094d\u0924\u0947 \u092e\u093e\u092e\u094d \u091c\u0928\u093e\u0903 \u0938\u0941\u0915\u0943\u0924\u093f\u0928\u0903 \u0905\u0930\u094d\u091c\u0941\u0928 \u0964\n\u0906\u0930\u094d\u0924\u094b \u091c\u093f\u091c\u094d\u091e\u093e\u0938\u0941\u0903 \u0905\u0930\u094d\u0925\u093e\u0930\u094d\u0925\u0940 \u091c\u094d\u091e\u093e\u0928\u0940 \u091a \u092d\u0930\u0924\u0930\u094d\u0937\u092d \u0965 \u0967\u096c \u0965","Arjuna, four types of virtuous people worship Me: The distressed, who want to regain what they lost, those who are curious, those who want to acquire wealth and those who know."],t.w)
