B.Mt=new A.d(B.c,["\u0936\u094d\u0930\u0940 \u092d\u0917\u0935\u093e\u0928\u094d \u0909\u0935\u093e\u091a -\n\u090a\u0930\u094d\u0927\u094d\u0935 \u092e\u0942\u0932\u092e\u094d \u0905\u0927\u0903 \u0936\u093e\u0916\u092e\u094d \u0905\u0936\u094d\u0935\u0924\u094d\u0925\u092e\u094d \u092a\u094d\u0930\u093e\u0939\u0941\u0930\u0935\u094d\u092f\u092f\u092e\u094d \u0964\n\u091b\u0928\u094d\u0926\u093e\u092e\u094d\u0938\u093f \u092f\u0938\u094d\u092f \u092a\u0930\u094d\u0923\u093e\u0928\u093f \u092f\u0938\u094d\u0924\u092e\u094d \u0935\u0947\u0926 \u0938 \u0935\u0947\u0926\u0935\u093f\u0924\u094d \u0965 \u0967 \u0965","The Lord says: It is said that the material world is like a pepal tree that does not wear out, with its roots at the top and branches at the bottom. Its leaves are the Vedas. The person who knows this tree is the one who knows the Vedas."],t.w)
