B.Nh=new A.d(B.c,["\u092f\u091c\u094d\u091e \u0926\u093e\u0928 \u0924\u092a\u0903 \u0915\u0930\u094d\u092e \u0928 \u0924\u094d\u092f\u093e\u091c\u094d\u092f\u092e\u094d \u0915\u093e\u0930\u094d\u092f\u092e\u094d \u090f\u0935 \u0924\u0924\u094d \u0964","Actions of worship, charity, and discipline are not to be given up. Such action must certainly be done."],t.w)
B.My=new A.d(B.c,["\u092f\u091c\u094d\u091e\u094b \u0926\u093e\u0928\u092e\u094d \u0924\u092a\u0903 \u091a\u0948\u0935 \u092a\u093e\u0935\u0928\u093e\u0928\u093f \u092e\u0928\u0940\u0937\u093f\u0923\u093e\u092e\u094d \u0965 \u096b \u0965","Worship, charity and discipline are definitely purifying for intelligent, devout people."],t.w)
